import React, { useState } from 'react';
import { Alert, Modal, Pressable, View, Text, StyleSheet, Button, TouchableOpacity } from 'react-native';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    paddingVertical: 20,
    paddingHorizontal: 20,
  },

buttonDir: {
  flexDirection: 'row',
  flex: 1,
},

  button: {
    borderRadius: 100,
    borderColor: "black",
    width: 80,
    height: 80,
    backgroundColor: "#008080",
    alignItems: "center",
    justifyContent: "center"
  },

  buttonText: {
    color: "white",
    fontWeight: "bold",
    textAlign: "center",
  },
});

const HomeScreen = ({ navigation }) => {
  return (
    <View style={styles.container}>
      <View style={styles.buttonDir}>
      <TouchableOpacity
        onPress={() => navigation.navigate('Venue')}
        style={styles.button}
      >
        <View>
          <Text style={styles.buttonText}>Venue</Text>
        </View>
      </TouchableOpacity>

      <TouchableOpacity
        onPress={() => navigation.navigate('BridalDress')}
        style={styles.button}
      >
        <View>
          <Text style={styles.buttonText}>BridalDress</Text>
        </View>
      </TouchableOpacity>

      <TouchableOpacity
        onPress={() => navigation.navigate('Caterer')}
        style={styles.button}
      >
        <View>
          <Text style={styles.buttonText}>Caterer</Text>
        </View>
      </TouchableOpacity>

      <TouchableOpacity
        onPress={() => navigation.navigate('Makeup')}
        style={styles.button}
      >
        <View>
          <Text style={styles.buttonText}>Makeup</Text>
        </View>
      </TouchableOpacity>

      <TouchableOpacity
        onPress={() => navigation.navigate('Photographer')}
        style={styles.button}
      >
        <View>
          <Text style={styles.buttonText}>Photographer</Text>
        </View>
      </TouchableOpacity>
      </View>
    </View>
  );
};

export default HomeScreen;

